Inform patients of the signs of an anaphylactic reaction (e.g., difficulty breathing, swelling of the face or throat). Instruct patients to seek immediate emergency help if these occur [see Contraindications (
                     ) and Warnings and Precautions (
                     5.1
                     )].

Inform pregnant women to avoid use of diclofenac sodium gel and other NSAIDs starting at 30 weeks gestation because of the risk of the premature closing of the fetal ductus arteriosus. If treatment with diclofenac sodium gel is needed for a pregnant woman between about 20 to 30 weeks gestation, advise her that she may need to be monitored for oligohydramnios, if treatment continues for longer than 48 hours [see Warnings and Precautions (5.11) and Use in Specific Populations (
                     8.1
                     )].

Inform patients that the concomitant use of diclofenac sodium gel with other NSAIDs or salicylates (e.g., diflunisal, salsalate) is not recommended due to the increased risk of gastrointestinal toxicity [see Warnings and Precautions (
                     )and Drug Interactions (
                           7
                        )]. Alert patients that NSAIDs may be present in “over the counter” medications for treatment of colds, fever, or insomnia.

Inform patients not to use low-dose aspirin concomitantly with diclofenac sodium gel until they talk to their healthcare provider [see Drug Interactions (
                     7
                     )].
